Hannibal is an American thriller television series developed by Bryan Fuller for NBC. The series is based on characters and elements appearing in the novel Red Dragon by Thomas Harris and focuses on the budding relationship between FBI special investigator Will Graham and Dr. Hannibal Lecter, a forensic psychiatrist destined to become Graham's most cunning enemy. The series received a 13 episode order for its first season and, unlike most U.S. network shows, any future seasons will also feature 13 episodes. David Slade executive produced and directed the pilot. The series premiered on NBC on April 4, 2013. On May 30, 2013, Hannibal was renewed for a second season of 13 episodes, which will air in 2014.


